import React, {Component} from 'react';
import factory from '../ethereum/factory';


class App extends Component{

    static getInitialProps(){
        const instance= factory.methods.getCampaignsDeployed().call();
        return {instance};
    }


    render(){
    return <div>{this.props.instance[0]}</div>;
    
    }
    
}

export default App;
